char *actionStr(const Action action) {
	switch (action) {
		case ERROR: return "ERROR";
		case REDUCE: return "REDUCE";
		case SHIFT: return "SHIFT";
		case ACCEPT: return "ACCEPT";
		case GOTO: return "GOTO";
	}
	return NULL;
}

